let theMainForm;

function ClientScript_OnAfterRender(form)
{
    theMainForm = form;

    _getCustomData("cstm_getPersonsPresent", { "@CalGUID": form.getComponent("cmbSession").getValue(), "@forminstanceguid": form.getComponent("__forminstanceguid").getValue() }).then(function (data)
    {
        if(data.length==0){return}

        form.getComponent("txtaPersonsPresent").setValue(data[0].Value);
        console.log("Value: - " + data[0].Value);
    });

    form.on('change', function(event)
    {
        if(event.changed && event.changed.component.key === 'cmbSession' && event.changed.value ){
            _getCustomData("cstm_getPersonsPresent", { "@CalGUID": form.getComponent("cmbSession").getValue(), "@forminstanceguid": form.getComponent("__forminstanceguid").getValue() }).then(function (data)
            {
                if(data.length==0){return}

                form.getComponent("txtaPersonsPresent").setValue(data[0].Value);
                console.log("Value: - " + data[0].Value);
            }); 
        }
    });
}

function CopyClinicalHistoryRecord(FormInstanceGUID, ContactGUID){
    _getCustomData("cstm_CopyClinicalHistory", { "@FormInstanceGUID": FormInstanceGUID, "@ContactGUID": ContactGUID }).then(function (data) {
        console.log("output", data, FormInstanceGUID, ContactGUID)
    });
}

